import { signInUser, getUserProfile } from "./features/userSlice";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";

function App(){
  const user = useSelector((state) => state.user)
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(signInUser({email: "tony@stark.com", password: "password123"}))
    dispatch(getUserProfile())
  }, null)

  return <div></div>
}
export default App
